import React from "react";
import ListActiveStyle from "./ListActiveStyle"


class ListActive extends React.PureComponent {
    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
        };
      }


      render() {
        return (
            <ListActiveStyle>
                <h3>LeftListActive</h3>
            </ListActiveStyle>
        )
      }
}


export default ListActive;
